export declare const GraphQLSchema = "#graphql\n\ntype User {\n  _id: ID!\n  name: String!\n  email: String!\n  passkey: String\n  createdAt: String\n  updatedAt: String\n  notes: [Note]\n}\n\ntype Note {\n  _id: ID!\n  title: String!\n  body: String!\n  userId: User!\n  createdAt: String\n  updatedAt: String\n  someUnknownAttribute: String\n}\n\ntype Query {\n  users: [User], # get all users \n  user(_id:ID!): User, # get user by id \n  notes: [Note], # get all notes \n}\n\ntype Mutation {\n  User(name:String!, email:String!, passkey:String!) : User # create new user \n}\n";
